#!/usr/bin/python
import base64

#Input your nested Base 64 in the inp_string
inp_string = ""

#For loop will run 13 times, specify as many as you need
times = 13
for i in range(times):
    inp_string = base64.b64decode(inp_string)
out_string = inp_string.decode('UTF-8')

#String will be written out
print("Never tell someone how many times something is encoded..")
print("Not that ciphers are a good way to store secrets anyway..")
print("Anyway, Here is your loot: ")
print(out_string)
